import React, {Component} from 'react';
import Navbar from './nav';
import OpenMenu from './openMenu';
import Main from './main';
import 'bootstrap/dist/css/bootstrap.min.css';

class Root extends Component {
    render(){
        return(
            <div>
                <nav>
                    <OpenMenu />
                    <Navbar />
                </nav>
                <Main />
            </div>
        );
    }
}   

export default Root;
